export default {
    
    name : 'sell_ingredient',
    props: {
        user_data : {
            type : Array,
            required : true
        },
        my_key : {
            type : Boolean,
            required : true,
        },
        final_round_order : {
            type : Array,
            required : true,
        },
        board_order : {
            type : Number,
            required : true,
        },
        board_cube_order : {
            type : Number,
            required : true,
        }
    },
    data () {
        return  {
            card_data : '',
            is_loaded : false,
        }
    },
    methods : {
        open_to_modal : function() {
            // 나의 카드 데이터 저장
            for(let i = 0; i < this.user_data.length; i++){
                if( this.my_key == this.user_data[i].user_key ){
                    this.card_data = this.user_data[i].user_ingame_data.ingredient;
                    break;
                }
            }
        },
    },
}
